import { Tabs, Box, Tab, Rating } from '@mui/material';
import React, { useState } from 'react';
import { Link, NavLink, useParams } from "react-router";
import "../../styles/styles.scss";
import { styled } from '@mui/material/styles';

const RestaurantPage = () => {
  let { id } = useParams();

  return (
    <div>
      <div style={{
        display: 'flex',
        flexDirection: 'row'
      }}>
        <div style={{
          flex: 2
        }}>
          <h1 className="bold-text title">McDonald's® (Adams  Wells)</h1>
          <p className="subtitle">
            Chinese
            Dim Sum
            Noodles
            Thai
            Open until 22:45
            £4.49 delivery
            £7.00 minimum
            1.94 miles away
            107 Lever Street, London, EC1V3RQ
            View map
          </p>
          <Rating name="half-rating-read" defaultValue={2.5} precision={0.5} readOnly />
        </div>

        <div
          style={{
            flex: 1,
          }}>

          <img
            style={{
              height: '100%',
              width: '100%'
            }}
            src="https://cdn.concreteplayground.com/content/uploads/2020/04/Family-Feast-KFC-supplied.jpg" />
        </div>

      </div>

      <div style={{ flex: 1 }}>
        <div style={{ height: '100px', width: '100%' }}>
          <Box sx={{ borderBottom: 1, borderColor: 'divider', }}>
            <StyledTabs

              selectionFollowsFocus
              scrollButtons="auto"
              variant="scrollable"
              aria-label="tab"
              textColor="#000">

              <StyledTab label="Burgers" />
              <Tab label="Chickens" />
              <Tab label="Item Three" />
              <Tab label="Item One" />
              <Tab label="Item Two" />
              <Tab label="Item Three" />
              <Tab label="Item One" />
              <Tab label="Item Two" />
              <Tab label="Item Three" />
              <Tab label="Item One" />
              <Tab label="Item Two" />
              <Tab label="Item Three" />
            </StyledTabs>
          </Box>

        </div>
      </div>
    </div >
  );
}
export default RestaurantPage

const StyledTab = styled((props) => <Tab disableRipple {...props} />)(
  ({ theme }) => ({
    textTransform: 'none',
    fontWeight: theme.typography.fontWeightRegular,
    fontSize: theme.typography.pxToRem(15),
    marginRight: theme.spacing(1),
    color: 'rgba(255, 255, 255, 0.7)',
    '&.Mui-selected': {
      color: '#fff',
    },
    '&.Mui-focusVisible': {
      backgroundColor: 'rgba(100, 95, 228, 0.32)',
    },
  }),
);

const StyledTabs = styled((props) => (
  <Tabs
    {...props}
    TabIndicatorProps={{ children: <span className="MuiTabs-indicatorSpan" /> }}
  />
))({
  '& .MuiTabs-indicator': {
    display: 'flex',
    justifyContent: 'center',
    backgroundColor: 'transparent',
  },
  '& .MuiTabs-indicatorSpan': {
    maxWidth: 40,
    width: '100%',
    backgroundColor: '#635ee7',
  },
});
